function cleanJsonFields(data) {
  return data.map(entry => {
    const cleanedContext = entry.context
      .split('\n')
      .filter(line => {
        const keyValue = line.split(':');
        const value = keyValue.slice(1).join(':').trim();
        // Keep lines that are not empty, not a dot, and have meaningful content
        return value && value !== '.' && value !== '..';
      })
      .join('\n');

    return { context: cleanedContext };
  });
}

const cleanedData = cleanJsonFields(input);
return cleanedData;

