// Process all input items
const output = items.map(item => {
  // Get the brandGuidelines field from the current item
  const brandGuidelines = item.json.brandGuidelines || "";
  const blogpost = item.json.blogpost || "";
  const transcript = item.json.transcript || "";
  const context = item.json.context || "";
  const inputBrief = item.json.inputBrief_clean || "";

  // Combine everything into the full final result
  const combinedResult = 
    "BRAND GUIDELINES:\n" + brandGuidelines + "\n" +
    "CONTEXT:\nBlogpost: " + blogpost + "\nTranscript: " + transcript + "\n\n" +
    context + "\n\n" +
    "DETAILS OF HOW TO STRUCTURE OUTPUT:\n" +
    "AI Output: This is where you will add your output. Do not provide any extra context, lines, headings or spaces.\n" +
    "You must also append to the end of your output the following on a new line for each:\n" +
    "Prompt Type: {insert exactly as my input prompt}\n" +
    "Product Type: {insert exactly as my input prompt}\n" +
    "Copy ID: {insert exactly as my input prompt}\n" +
    "PROMPT: Here is the prompt to complete: " + inputBrief;

  // Escape combinedResult properly
  const formattedOutput = combinedResult
    .replace(/\\/g, '\\\\')   // Escape existing backslashes
    .replace(/\n/g, '\\n')    // Escape newlines
    .replace(/"/g, '\\"');    // Escape double quotes

  // Return the formatted output for the current item
  return {
    json: {
      result: formattedOutput
    }
  };
});

// Return all processed items
return output;

// Process all input items
const output = items.map(item => {
  // Access the result field
  const resultContent = item.json.result;

  // Ensure result content exists and is valid
  if (!resultContent) {
    return {
      "Prompt Type": null,
      "Product Type": null,
      "Copy ID": null,
      "Error": "result content is missing or undefined"
    };
  }

  // Extract Prompt Type, Product Type, and Copy ID using regex
  const promptTypeMatch = resultContent.match(/Prompt Type: (.+?)(?:\\n|$)/);
  const productTypeMatch = resultContent.match(/Product Type: (.+?)(?:\\n|$)/);
  const copyIdMatch = resultContent.match(/Copy ID: (.+?)(?:\\n|$)/);

  // Return the extracted values for the current item
  return {
    "Prompt Type": promptTypeMatch ? promptTypeMatch[1].trim() : null,
    "Product Type": productTypeMatch ? productTypeMatch[1].trim() : null,
    "Copy ID": copyIdMatch ? copyIdMatch[1].trim() : null
  };
});

// Return the mapped output
return output;

